member.summary:
 借款类型	0 代表信用标,1 担保标;2 抵押,质押标, 3 秒标;
 4 债权转让标(流转标,二级市场标的);5 理财计划(宝类业务_活期);
6 其它;7 净值标;8 活动标(体验标).9 理财计划(宝类业务_定期).
3，4，5标类型不参与贷款余额计算；请注意5【理财计划(宝类业务_活期)】和【9理财计划(宝类业务_定期)】的区分；4债权转让标指的是不会产生新待还的转让
 如果会产生新待还，请返回其他标类型.

还款方式	
0 代表其他;
1 按月等额本息还款;
2按月付息,到期还本;
3 按天计息,一次性还本付息;
4,按月计息,一次性还本付息;
5 按季分期还款;
6 为等额本金,按月还本金;
7 先息期本.
